import React from "react";
import { Headline, Navigation, SubmitForm } from "../components";

class SubmitPage extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {

    return (
      <div>
        <Headline />
        <Navigation />
        <SubmitForm />
      </div>
    );
  };
  }  
  
  
  export default SubmitPage;
